export default function MainBanner(){
    return(
        <div className="bannerPrincipal">

            <div className="apresentacaoPessoal">
                <h2><TypingTextAnimation delay={50} text='Olá, meu nome é Filipe e eu sou um...' /></h2>
            </div>
            <div className="tituloA+icones">
                <div className="tituloA w50">
                    <FadeIn delay={1900} transitionDuration={1000}><h1>React</h1></FadeIn>
                </div>

                <div className="icones w50">
                    <Icones />
                </div>
            </div>

            <div className="tituloB">
                <FadeIn delay={1900} transitionDuration={1000}><h1>React</h1></FadeIn>
            </div>

            <div className="enviarEmail w51">

            </div>

        </div>
    );
}
